	protected void savePOIcsv() {
		Iterator<?> iter3 = mapHashMap.entrySet().iterator();
		while (iter3.hasNext()) {
			@SuppressWarnings("unchecked")
			java.util.Map.Entry<String, Map> entry = (java.util.Map.Entry<String, Map>) iter3.next();
			String key = entry.getKey();
			HashMap<String, POI> temp = poiHashMap.get(key);
			Iterator<?> tempIter = temp.entrySet().iterator();
			while (tempIter.hasNext()) {
				try {
					@SuppressWarnings("unchecked")
					java.util.Map.Entry<String, POI> tempEntry = (java.util.Map.Entry<String, POI>) tempIter.next();
					POI poi = tempEntry.getValue();
					if (poi.getPoiMode() == POI.POI_MODE_LABEL && !"".equals(poi.getName())) {
						File file1 = new File(MapCommonUtil.SDCARD_DIR + "CSV");
						if (!file1.exists()) {
							file1.mkdirs();
						}
						File csv = new File(MapCommonUtil.SDCARD_DIR + "CSV/poi.csv");

						BufferedWriter bw = new BufferedWriter(new FileWriter(csv, true));
						bw.newLine();
						String str = poi.getName();
						String dest = "";

						if (str != null) {

							Pattern p = Pattern.compile("\\s*|\t|\r|\n");

							Matcher m = p.matcher(str);

							dest = m.replaceAll("");

						}

						bw.write(dest + "," + poi.getPoint().getX() + "," + poi.getPoint().getY() + "," + poi.getMapName());
						bw.close();
					}
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
		}
	}
